INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 7, 0, 1, 0.0, 1, 7001, "2015/12/17 15:00:00", 1, -363.0, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 7, 0, 1, 0.0, 1, 7002, "2015/12/17 15:00:00", 1, -363.0, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 7, 0, 1, 0.0, 1, 7003, "2015/12/17 15:00:00", 1, -363.0, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 10, 0, 1, 0.0, 1, 10001, "2015/12/17 15:00:00", 1, -363.0, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 10, 0, 1, 0.0, 1, 10002, "2015/12/17 15:00:00", 1, -363.0, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 10, 0, 1, 0.0, 1, 10003, "2015/12/17 15:00:00", 1, -363.0, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 10, 2104010, 1, 0.0, 1, 10004, "2015/12/17 15:00:00", 2, -363.0, 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 12, 0, 1, 0.0, 1, 12001, "2015/12/17 15:00:00", 1, -416.5, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 13, 0, 1, 0.0, 1, 13001, "2015/12/17 15:00:00", 1, -363.0, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 13, 0, 1, 0.0, 1, 13002, "2015/12/17 15:00:00", 1, -363.0, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 13, 2104010, 1, 0.0, 1, 13003, "2015/12/17 15:00:00", 2, -363.0, 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 13, 0, 1, 0.0, 1, 13004, "2015/12/17 15:00:00", 1, -363.0, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 14, 0, 1, 0.0, 1, 14001, "2015/12/17 15:00:00", 1, -363.0, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 14, 2104010, 1, 0.0, 1, 14002, "2015/12/17 15:00:00", 2, -363.0, 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 14, 0, 1, 0.0, 1, 14003, "2015/12/17 15:00:00", 1, -363.0, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 14, 0, 1, 0.0, 1, 14004, "2015/12/17 15:00:00", 1, -363.0, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 15, 0, 1, 0.0, 1, 15001, "2015/12/17 15:00:00", 1, -470.0, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 16, 2104010, 1, 0.0, 1, 16001, "2015/12/17 15:00:00", 2, -363.0, 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 16, 0, 1, 0.0, 1, 16002, "2015/12/17 15:00:00", 1, -363.0, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 16, 0, 1, 0.0, 1, 16003, "2015/12/17 15:00:00", 1, -363.0, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 16, 0, 1, 0.0, 1, 16004, "2015/12/17 15:00:00", 1, -363.0, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 17, 0, 1, 0.0, 1, 17002, "2015/12/17 15:00:00", 1, -363.0, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 25, 0, 1, 0.0, 1, 17004, "2015/12/17 15:00:00", 1, -363.0, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 25, 0, 1, 0.0, 1, 17005, "2015/12/17 15:00:00", 1, -363.0, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 25, 2104010, 1, 0.0, 1, 17006, "2015/12/17 15:00:00", 2, -363.0, 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 25, 0, 1, 0.0, 1, 17007, "2015/12/17 15:00:00", 1, -363.0, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 18, 0, 1, 0.0, 1, 18001, "2015/12/17 15:00:00", 1, -363.0, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 18, 0, 1, 0.0, 2, 18002, "2015/12/17 15:00:00", 1, -363.0, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 19, 0, 1, 0.0, 3, 19001, "2015/12/17 15:00:00", 1, -470.0, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 19, 0, 1, 0.0, 4, 19002, "2015/12/17 15:00:00", 1, -470.0, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 20, 0, 1, 0.0, 5, 20001, "2015/12/17 15:00:00", 1, -470.0, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 20, 0, 1, 0.0, 6, 20002, "2015/12/17 15:00:00", 1, -470.0, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 21, 0, 1, 0.0, 1, 21001, "2015/12/17 15:00:00", 1, -363.0, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 21, 0, 1, 0.0, 1, 21002, "2015/12/17 15:00:00", 1, -363.0, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 21, 2104010, 1, 0.0, 1, 21003, "2015/12/17 15:00:00", 2, -363.0, 0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 21, 0, 1, 0.0, 1, 21004, "2015/12/17 15:00:00", 1, -363.0, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 22, 0, 1, 0.0, 1, 22001, "2015/12/17 15:00:00", 1, -430.0, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 22, 0, 1, 0.0, 2, 22002, "2015/12/17 15:00:00", 1, -430.0, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 23, 0, 1, 0.0, 3, 23001, "2015/12/17 15:00:00", 1, -430.0, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 23, 0, 1, 0.0, 4, 23002, "2015/12/17 15:00:00", 1, -430.0, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "カリン", 190801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (4.08, 24, 0, 2, 8.0, 1, 24001, "2019/01/31 12:00:00", 1, -385.0, 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5.0, 24, 0, 2, 8.0, 2, 24002, "2019/01/31 12:00:00", 1, -385.0, 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10.11, 24, 0, 2, 8.0, 3, 24003, "2019/01/31 12:00:00", 1, -385.0, 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (4.0, 24, 0, 2, 8.0, 4, 24004, "2019/01/31 12:00:00", 1, -385.0, 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (6.0, 24, 0, 2, 8.0, 5, 24005, "2019/01/31 12:00:00", 1, -385.0, 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 6, 24006, "2019/01/31 12:00:00", 1, 0.0, 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 7, 24007, "2019/01/31 12:00:00", 1, 0.0, 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 8, 24008, "2019/01/31 12:00:00", 1, 0.0, 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 9, 24009, "2019/01/31 12:00:00", 1, 0.0, 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 10, 24010, "2019/01/31 12:00:00", 1, 0.0, 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2.12, 24, 0, 2, 8.0, 1, 24011, "2019/01/31 12:00:00", 1, -385.0, 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 109101, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (4.19, 24, 0, 2, 8.0, 2, 24012, "2019/01/31 12:00:00", 5, -385.0, 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 109101, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2.3, 24, 0, 4, 8.0, 3, 24013, "2019/01/31 12:00:00", 2, -385.0, 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 109101, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 4, 24014, "2019/01/31 12:00:00", 1, 0.0, 10011, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 109102, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5.23, 24, 0, 2, 8.0, 5, 24015, "2019/01/31 12:00:00", 5, -385.0, 10011, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 109101, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 6, 24016, "2019/01/31 12:00:00", 1, 0.0, 10011, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 109102, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5.01, 24, 0, 2, 8.0, 7, 24017, "2019/01/31 12:00:00", 1, -385.0, 10011, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 109101, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 8, 24018, "2019/01/31 12:00:00", 1, 0.0, 10011, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 109102, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 9, 24019, "2019/01/31 12:00:00", 1, 0.0, 10011, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 109102, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24, 0, 1, 0.0, 10, 24020, "2019/01/31 12:00:00", 1, 0.0, 10011, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 109102, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 26, 2104010, 1, 0.0, 1, 26001, "2015/12/17 15:00:00", 2, -363.0, 0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 26, 0, 1, 0.0, 1, 26002, "2015/12/17 15:00:00", 1, -363.0, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 26, 0, 1, 0.0, 1, 26003, "2015/12/17 15:00:00", 1, -363.0, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 26, 0, 1, 0.0, 1, 26004, "2015/12/17 15:00:00", 1, -363.0, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 27, 2104010, 1, 0.0, 1, 27001, "2015/12/17 15:00:00", 2, -363.0, 0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 27, 0, 1, 0.0, 1, 27002, "2015/12/17 15:00:00", 1, -363.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 27, 0, 1, 0.0, 1, 27003, "2015/12/17 15:00:00", 1, -363.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "キャル", 106001, "2030/12/17 14:59:59");
