INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 28, 0, 1, 0.0, 1, 28001, "2019/09/24 15:00:00", 1, -363.0, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", "カリン", 190801, "2030/12/17 14:59:59");
