INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 41, 0, 1, 0.0, 1, 41003, "2015/12/17 15:00:00", 1, -363.0, 0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 41, 0, 1, 0.0, 1, 41004, "2015/12/17 15:00:00", 1, -363.0, 0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 42, 0, 1, 0.0, 1, 42001, "2015/12/17 15:00:00", 1, -416.5, 0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 42, 2104010, 1, 0.0, 1, 42002, "2015/12/17 15:00:00", 1, -416.5, 0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "シェフィ", 106401, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 42, 0, 1, 0.0, 1, 42003, "2015/12/17 15:00:00", 1, -416.5, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 42, 0, 1, 0.0, 1, 42004, "2015/12/17 15:00:00", 1, -416.5, 0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 43, 0, 1, 0.0, 1, 43001, "2015/12/17 15:00:00", 1, -363.0, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "ペコリーヌ", 105801, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 43, 0, 1, 0.0, 1, 43002, "2015/12/17 15:00:00", 1, -363.0, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "コッコロ", 105901, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 43, 0, 1, 0.0, 1, 43003, "2015/12/17 15:00:00", 1, -363.0, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "キャル", 106001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 44, 0, 1, 0.0, 1, 43004, "2015/12/17 15:00:00", 1, -416.5, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "アメス", 123001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 44, 0, 1, 0.0, 2, 43005, "2015/12/17 15:00:00", 1, -416.5, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "アメス", 123001, "2030/12/17 14:59:59");
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5.79, 45, 0, 2, 0.0, 3, 43006, "2015/12/17 15:00:00", 1, -416.5, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "アメス", 123001, "2030/12/17 14:59:59");
